import React, { Component } from 'react';

class utility extends Component {

	render() {
		return (
			<div className='contanier'>
                <div className='row'>
                    <div className='col-4'>
				<h1>wow</h1>
                </div>
                </div>
			</div>
		);
	}
}
export default utility;
